    false,nt"url": null,nt"notes": "Fish were collected from Neosho National
    Fish Hatchery (NNFH) to determine if metal or organic contaminants were elevated
    in the biota located on the hatchery. Whole fish samples were analyzed, results
    were compared to the literature, and potential contaminant problems were recognized.
    Concentrations of copper and zinc either exceeded or were the same as concentrations
    reported from polluted sites in the literature. However, differing tissue types
    analyzed may demonstrate the reason for the apparent concentrations of concern.
    Chlordane residue concentrations exceeded the Missouri human consumption advisory
    concentration, but the advisory is based on edible tissues rather than whole fish
    samples. If there are problems with the health of the fish at NNFH, further investigations
    into these compounds should be initiated.",nt"license_title": "License Not
